IF NOT EXISTS (
    select * from sysobjects where name='volcanoes' and xtype='U'
) CREATE TABLE volcanoes (
    [items_id] INT,
    [items_year] INT,
    [items_month] INT,
    [items_day] INT,
    [items_tsunamiEventId] INT,
    [items_earthquakeEventId] INT,
    [items_volcanoLocationId] INT,
    [items_volcanoLocationNewNum] INT,
    [items_volcanoLocationNum] NVARCHAR(8),
    [items_name] NVARCHAR(25),
    [items_location] NVARCHAR(20),
    [items_country] NVARCHAR(28),
    [items_latitude] NUMERIC(5, 3),
    [items_longitude] NUMERIC(6, 3),
    [items_elevation] INT,
    [items_morphology] NVARCHAR(19),
    [items_vei] INT,
    [items_agent] NVARCHAR(7),
    [items_deathsTotal] INT,
    [items_deathsAmountOrderTotal] INT,
    [items_damageAmountOrderTotal] INT,
    [items_housesDestroyedTotal] INT,
    [items_housesDestroyedAmountOrderTotal] INT,
    [items_significant] NVARCHAR(4),
    [items_publish] NVARCHAR(5),
    [items_status] NVARCHAR(16),
    [items_timeErupt] NVARCHAR(7),
    [items_deathsAmountOrder] INT,
    [items_injuriesTotal] INT,
    [items_injuriesAmountOrderTotal] INT,
    [items_damageAmountOrder] INT,
    [items_deaths] INT,
    [items_housesDestroyedAmountOrder] INT,
    [items_injuries] INT,
    [items_injuriesAmountOrder] INT,
    [items_damageMillionsDollars] NUMERIC(7, 3),
    [items_housesDestroyed] INT,
    [items_damageMillionsDollarsTotal] NUMERIC(7, 3),
    [items_missing] INT,
    [items_missingAmountOrder] INT,
    [items_missingTotal] INT,
    [items_missingAmountOrderTotal] INT
);
